private Document parse() {
    while (!tq.isEmpty()) {
        if (tq.matchesStartTag()) {
            parseStartTag();
        } else if (tq.matchesCS("</")) {
            parseEndTag();
        } else if (tq.matchesCS("<!--")) {
            parseComment();
        } else if (tq.matches("<![CDATA[")) {
            parseCdata();
        } else if (tq.matchesCS("<?") || tq.matchesCS("<!")) {
            parseXmlDecl();
        } else {
            parseTextNode();
        }
    }
    return doc.normalise();
}

